/** * List add to cart buttons */var ProductCartButton = (function(superClass) {	extend(ProductCartButton, superClass);	function ProductCartButton() {		return ProductCartButton.__super__.constructor.apply(this, arguments);	}	ProductCartButton.prototype.successSubmit = function ($item, data) {		ProductCartButton.__super__.successSubmit.call(this, $item, data);		$item.find('.select').select2('data', null);	};	ProductCartButton.prototype.errorSubmit = function ($item, data) {		$item.find('.select').addClass('error');	};	return ProductCartButton;})(CartButtons);$(window).ready(function () {	new ProductCartButton();});